void APP_Init(void)
{
	RTCC_Init();

	BUZZER_SetVolume(1);
	BUZZER_On();
	HAL_Delay(250);
	BUZZER_Off();

	CONSOLE_Init();

	VERSION_Get();

	DISPLAY_Init();

	//SDCARD_Test();

	ADS_Test();
	ADS_Init();

	RGB_On();

	NEOPIXEL_Init();
	NEOPIXEL_Write_Matrix();

	COLORS_R = 0x10;
	COLORS_G = 0;
	COLORS_B = 0x10;

	COLORS_state = red;

	ST7789_Init();
	ST7789_InvertColors(0);
//	ST7789_Test();

	ST7789_DrawImage(0, 0, 240, 320, logo_MechatronixLab);

	ISR_StartInterruptTimer();

	APP_Run();
}

void APP_Run(void)
{
	int32_t adc_reading = 0;
	int32_t adc_voltage = 0;

	uint32_t adc_buffer[6];

	uint32_t counter = 0;

	RTC_DateTypeDef RTCC_date;
	RTC_TimeTypeDef RTCC_time;

	char string_buffer[22];

	while (1)
	{



		if (ISR_interrupt_flag)
		{
			ISR_interrupt_flag = 0;
			HAL_GPIO_TogglePin(LED_USER_GPIO_Port, LED_USER_Pin);

			adc_reading = ADS_GetConversion();
			adc_voltage = (adc_reading * 6144) / 32767;
//			CLI_Print("UART: Counter: %8d ; ADS1115[0] = 0x%4x ; %4d mV. \r\n", counter, adc_reading, adc_voltage);
//			USB_CDC_Print("USB CDC: Counter: %8d ; ADS1115[0] = 0x%4x ; %4d mV. \r\n", counter, adc_reading, adc_voltage);
			counter++;

			if ((counter % 10) == 0)
			{
				HAL_RTC_GetTime(&hrtc, &RTCC_time, RTC_FORMAT_BIN);
				HAL_RTC_GetDate(&hrtc, &RTCC_date, RTC_FORMAT_BIN);

				USB_CDC_Print("20%02d.%02d.%02d %02d:%02d:%02d \r\n",
								RTCC_date.Year, RTCC_date.Month, RTCC_date.Date,
								RTCC_time.Hours, RTCC_time.Minutes, RTCC_time.Seconds);


				sprintf(string_buffer, "20%02d.%02d.%02d", RTCC_date.Year, RTCC_date.Month, RTCC_date.Date);
				OLED_SetCursor(67, 2);
				GFX_DrawString((uint8_t *)GFX_font_5x7, string_buffer);

				sprintf(string_buffer, " %02d:%02d:%02d ", RTCC_time.Hours, RTCC_time.Minutes, RTCC_time.Seconds);
				OLED_SetCursor(67, 3);
				GFX_DrawString((uint8_t *)GFX_font_5x7, string_buffer);

				HAL_ADC_Start_DMA(&hadc1, (uint32_t *)adc_buffer, 5);

			}

			// shift LED Matrix
			for (LED_id = 1; LED_id < NEOPIXEL_MATRIX_NUM_LEDS; LED_id++)
			{
				LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id][0] = LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id - 1][0];
				LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id][1] = LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id - 1][1];
				LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id][2] = LED_matrix_data[NEOPIXEL_MATRIX_NUM_LEDS - LED_id - 1][2];
			}
			// new color (sweep)
			COLORS_Sweep();

			// Add new color to 1st LED
			NEOPIXEL_Set_Color(0, COLORS_R, COLORS_G, COLORS_B);

			NEOPIXEL_Write_Matrix();
		}

		if (ISR_flag_ADC_EOC)
		{
			adc_reading = (adc_buffer[0] * 3300) / 4095;

			sprintf(string_buffer, "A0%4dmV", adc_reading);
			OLED_SetCursor(67, 4);
			GFX_DrawString((uint8_t *)GFX_font_5x7, string_buffer);

			adc_reading = (adc_buffer[4] * 3300 * 4) / 4095;

			sprintf(string_buffer, "VB%4dmV", adc_reading);
			OLED_SetCursor(67, 5);
			GFX_DrawString((uint8_t *)GFX_font_5x7, string_buffer);

			USB_CDC_Print("ADC[CH0]: %4d ; ADC[CH1]: %4d ; ADC[CH2]: %4d ; ADC[CH3]: %4d ; ADC[VBAT]: %4d \r\n",
								(adc_buffer[0] * 3300) / 4095,
								(adc_buffer[1] * 3300) / 4095,
								(adc_buffer[2] * 3300) / 4095,
								(adc_buffer[3] * 3300) / 4095,
								(adc_buffer[4] * 3300 * 4) / 4095);

			ISR_flag_ADC_EOC = 0;
		}

		if (BUTTONS_debounced_press)
		{
			switch (BUTTONS_output)
			{
				case (BUTTONS_UP):
					RGB_SetColor(120, 120,   0);
					CLI_Write("UP! \r\n");
					break;

				case (BUTTONS_UP | BUTTONS_RIGHT):
					RGB_SetColor(180,  60,   0);
					CLI_Write("UP-RIGHT! \r\n");
					break;

				case BUTTONS_RIGHT:
					RGB_SetColor(240,   0,   0);
					CLI_Write("RIGHT! \r\n");
					break;

				case (BUTTONS_RIGHT | BUTTONS_DOWN):
					RGB_SetColor(120, 120,   0);
					CLI_Write("DOWN-RIGHT! \r\n");
					break;

				case BUTTONS_DOWN:
					RGB_SetColor(  0, 240,   0);
					CLI_Write("DOWN! \r\n");
					break;

				case (BUTTONS_DOWN | BUTTONS_LEFT):
					RGB_SetColor(  0, 120, 120);
					CLI_Write("DOWN-LEFT! \r\n");
					break;

				case BUTTONS_LEFT:
					RGB_SetColor(  0,   0, 240);
					CLI_Write("LEFT! \r\n");
					break;

				case (BUTTONS_LEFT | BUTTONS_UP):
					RGB_SetColor( 40,  40, 120);
					CLI_Write("UP-LEFT! \r\n");
					break;

				case BUTTONS_CENTER:
					RGB_SetColor( 80,  80,  80);
					CLI_Write("CENTER! \r\n");
					break;

				case BUTTONS_USER:
					RGB_SetColor(120,   0, 120);
					//CLI_Write("USER! \r\n");
					break;

				default:
					RGB_SetColor(  0,   0,   0);
					break;
			}

			ISR_button = 0;

			BUTTONS_debounced_press = 0;
		}

//		if (HAL_GPIO_ReadPin(SD_NIN_GPIO_Port, SD_NIN_Pin))
//		{
//			RGB_SetColor(255,   0,   0);
//		}
//		else
//		{
//			RGB_SetColor(  0, 255,   0);
//		}
	}
}

